script: |
  super -f tsv -I q5392.sql | sort > q5392.out

vector: true

inputs:
  - name: q5392.sql
    data: |
      SELECT 11 AS col2 FROM tab2 AS cor0 WHERE NOT ( ( NOT - col1 NOT BETWEEN ( - - col2 ) AND + col0 + + col2 ) );
  - name: tab2

outputs:
  - name: q5392.out
    data: |
      11
      11
      11
